import React from "react";
import styled from "styled-components";

const Li = styled.li`
  font-family: "Lato", sans-serif;
  font-weight: 600;
  font-size: 24px;
  line-height: 24px;
  text-decoration: none;
  list-style: none;
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
`;

const ListItemComponent = () => {
  return (
    <>
      <ListItem>
        <StyledLink style={{ color: "#F8B319" }} to="/movies">
          Movies
        </StyledLink>
      </ListItem>
      <ListItem>
        <StyledLink to="/tv-shows">TV Shows</StyledLink>
      </ListItem>
      <ListItem>
        <StyledLink to="/anime">Anime</StyledLink>
      </ListItem>
    </>
  );
};

export default ListItemComponent;
